insert  into `calons`(`id`,`nama`,`nim`,`angkatan`,`prodi`,`deskripsi`,`visi`,`misi`,`foto`,`created_at`,`updated_at`) values 
(5,'Komang Gelen Stalin & I Dewa Gede Taksu Septa Reksa','1812541001','2018','Ilmu Politik&Administrasi Negara','<p>Riwayat Organisasi</p><p><strong>Komang Gelen Stalin</strong></p><p>1. Bem Fisip Universitas Udayana 2019-sekarang</p><p><strong>&nbsp;I Dewa Gede Taksu Septa Reksa</strong></p><p>1. Bem Fisip Universitas Udayana 2019-sekarang</p>','<p>Terwujudnya BEM FISIP Universitas Udayana yang berjiwa sosial, berani, gigih, bertanggung jawab, dan berkeinginan belajar yang tinggi, serta mampu menciptakan suasana yang hangat dan kekeluargaan baik di lingkungan FISIP Udayana ataupun sekitarnya.</p>','<p>1. Menjadikan BEM FISIP UNUD sebagai wadah untuk mengembangkan kompetensi diri,</p><p>2. Menjadikan BEM FISIP UNUD berani dan bertanggung jawab dalam melihat permasalahan sosial dan politik dari berbagai sisi,</p><p>3. Mewujudkan BEM FISIP UNUD yang mempunyai jiwa gigih untuk mengabdi serta peduli terhadap lingkungan,</p><p>4. Menjadikan BEM FISIP UNUD contoh dan panutan yang baik untuk orang lain dengan menciptakan suasana yang hangat dan kekeluargaan baik di internal maupun eksternal,</p><p>5. Menjadikan Tri Dharma Perguruan Tinggi sebagai dasar seluruh kegiatan yang dilaksanakan BEM FISIP UNUD.</p>','1604246744_1602492720147-min-removebg-preview.png','2020-11-01 15:17:50','2020-11-01 16:05:44'),
